module.exports = "<form ng-submit=\"createReport()\">\n\t<label for=\"name\">Name: </label>\n\t<input id=\"name\" type=\"text\" ng-model=\"report.name\">\n\n\t<label for=\"category\">Category: </label> \n\t<select id=\"category\" ng-model=\"report.category\">\n\t\t<option value=\"pet\">Pet</option>\n\t\t<option value=\"phone\">Phone</option>\n\t\t<option value=\"other\">Other</option>\n\t</select>\n\n\t<label for=\"dateFound\">Date found: </label>\n\t<input id=\"dateFound\" type=\"date\" ng-model=\"report.dateFound\">\n\n\t<label for=\"locationFound\">Location found: </label>\n\t<input id=\"locationFound\" type=\"text\" ng-model=\"report.locationFound\">\n\n\t<label for=\"description\">Description: </label>\n\t<input id=\"description\" type=\"text\" ng-model=\"report.description\">\n\n\t<label for=\"image\">Select image: </label>\n\t<input id=\"image\" type=\"file\" accept=\"image/*\" multiple>\n\n\t<label for=\"imagePreview\">Image preview (click to remove): </label>\n\t<div class=\"gallery\">\n\t\t<img ng-repeat=\"image in report.image\" src=\"{{image}}\" id=\"imagePreview\" ng-click=\"removeImage($index)\">\n\t</div>\n\n\t<label></label>\n\t<button id=\"report\" type=\"submit\">Report item</button>\n</form>"